INSERT INTO `cache_field` VALUES ('field:node:1','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1454:\"<STYLE TYPE=\"text/css\">\r\n<!--\r\nP {text-indent: 30pt;}\r\n-->\r\n</STYLE> <p align=\"justify\"> <p style=\"font-family: arial; font-size:13pt\"> Join us for VietFest, June 23, 2012, at George Mason University in Virginia for a unique and spectacular celebration of the best of Vietnamese cuisine, culture, art and entertainment. The festival will feature renowned musical guests; modern fashion from top young designers; and the finest cuisine of the Greater Washington, D.C. area. Other highlights will include a beauty pageant, photo contest and other exciting events.  </p>\r\n\r\n<h2>Event Highlight</h2>\r\n<div class=\"box-4\">\r\n            <a href=\"node/12\"><img src=\"sites/all/themes/vietfest/images/home/pho_bowl.jpg\" alt=\"Pho-Eating Contest\"/></a>\r\n            <h3><a href=\"node/12\">Phở Eating Contest</a></h3>   \r\n</div>\r\n<div class=\"box-4\">\r\n             <a href=\"node/10\"><img src=\"sites/all/themes/vietfest/images/home/photo_contest.jpg\" alt=\"Photo contest\"/></a>\r\n            <h3> <a href=\"node/10\">Photography Contest</a></h3>            \r\n</div>\r\n<div class=\"box-4 box-last\">\r\n             <a href=\"node/13\"><img src=\"sites/all/themes/vietfest/images/home/chess.jpg\" alt=\"Games and much more\"/></a>\r\n             <h3><a href=\"node/12\">Chess (Cờ Tướng) </a> and much  <a href=\"contests\">more </a> !</h3>            \r\n</div>\r\n\r\n<iframe width=\"910\" height=\"512\" src=\"http://www.youtube.com/embed/cfgk5I4o0K0\" frameborder=\"0\" allowfullscreen></iframe>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1421:\"<style type=\"text/css\">\n<!--/*--><![CDATA[/* ><!--*/\n\n<!--\nP {text-indent: 30pt;}\n-->\n\n/*--><!]]>*/\n</style><p align=\"justify\">\n</p><p style=\"font-family: arial; font-size:13pt\"> Join us for VietFest, June 23, 2012, at George Mason University in Virginia for a unique and spectacular celebration of the best of Vietnamese cuisine, culture, art and entertainment. The festival will feature renowned musical guests; modern fashion from top young designers; and the finest cuisine of the Greater Washington, D.C. area. Other highlights will include a beauty pageant, photo contest and other exciting events.  </p>\n<h2>Event Highlight</h2>\n<div class=\"box-4\">\n            <a href=\"node/12\"><img src=\"sites/all/themes/vietfest/images/home/pho_bowl.jpg\" alt=\"Pho-Eating Contest\" /></a>\n<h3><a href=\"node/12\">Phở Eating Contest</a></h3>\n</div>\n<div class=\"box-4\">\n             <a href=\"node/10\"><img src=\"sites/all/themes/vietfest/images/home/photo_contest.jpg\" alt=\"Photo contest\" /></a>\n<h3> <a href=\"node/10\">Photography Contest</a></h3>\n</div>\n<div class=\"box-4 box-last\">\n             <a href=\"node/13\"><img src=\"sites/all/themes/vietfest/images/home/chess.jpg\" alt=\"Games and much more\" /></a>\n<h3><a href=\"node/12\">Chess (Cờ Tướng) </a> and much  <a href=\"contests\">more </a> !</h3>\n</div>\n<iframe width=\"910\" height=\"512\" src=\"http://www.youtube.com/embed/cfgk5I4o0K0\" frameborder=\"0\" allowfullscreen=\"\"></iframe>\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124620,1),('field:node:10','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:3061:\"<div class=\"box-3\">\r\n    <p><a href=\"http://www.vnps.net\"><img src=\"http://www.vnps.net/_/rsrc/1298229129085/config/customLogo.gif?revision=1\" alt=\"Photography Contest\"/></a><br /></p>\r\n\r\n         <form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n             <input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n             <input type=\"hidden\" name=\"hosted_button_id\" value=\"2539BJ694EJ54\">\r\n             <input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n             <img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n         </form>\r\n\r\n</div>\r\n		\r\n<div class=\"box-10 box-last\">\r\n    \r\n    <b> Photography Contest</b>\r\n    sponsored by <a href=\"http://www.vnps.net\">The Vietnamese Photographic Sociciety (VNPS)</a>\r\n    \r\n    <b>Theme</b>: Open\r\n    Each participant may enter a maximum of 4 digital color images\r\n    <b>Entry Fee</b>: $10 \r\n    All entries and entrance fees must be received by <b>May 12, 2012.</b>\r\n    \r\n    <b>Judging Criteria</b>\r\n    All digital images will be judged by the Vietnamese Photographic Society (VNPS)\r\n    The judges\' decisions are final.\r\n    Winning images will be displayed at the festival including those accepted from the Judges Panel\r\n    Awards will be presented to the winners at the festival\r\n    <b>Awards:</b>: VNPS Gold, VNPS Silver and VNPS Bronze Mdeals,  and 12 Honorable Mentions (HMs) will be awarded\r\n    \r\n    <b>Digital Image Rules</b>\r\n    •   Each entrant may submit a max of 4 digital color images in JPG format \r\n    •   Maximum digital image width (horizontal) is 1024 pixels\r\n    •   Maximum digital image height (vertical) is 768 pixels \r\n    •   Invalid image format and size will be disqualified from the contest\r\n    \r\n    <img src=\"http://vietfest.com/sites/all/themes/vietfest/images/contests/ImageSize.jpg\" alt=\"Image Size\" />\r\n    \r\n    <b> Copyright and Reproduction</b>\r\n    •   The copyright of all submitted work, including full control of use, must be at the disposal of the entrant.  All contributing images must be the work of the photographer and clip art and other imagery derived from a commercial source is unacceptable, even if free of copyright.\r\n    •   VietFest and VNPS accept no liability for any breach of copyright by an entrant. The copyright of all entries remains with the authors.\r\n    •   VietFest and VNPS reserve the right to reproduce, without payment, any accepted images for publicity and promotion purposes in connection with the contest and VietFest and VNPS in general, including VietFest and VNPS website.\r\n    \r\n    Those who win award(s) agree to email their award winning pictures at higher resolution to the organizing committee for exhibition purpose by <b>June 9, 2012.</b>\r\n    List of awards and list of acceptances will be available on <b> June 9th 2012</b>\r\n\r\n    Questions, comments or issue. Please contact photography@vietfest.com\r\n</div>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:3128:\"<div class=\"box-3\">\n<p><a href=\"http://www.vnps.net\"><img src=\"http://www.vnps.net/_/rsrc/1298229129085/config/customLogo.gif?revision=1\" alt=\"Photography Contest\" /></a></p>\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\n             <input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\" /><br /><input type=\"hidden\" name=\"hosted_button_id\" value=\"2539BJ694EJ54\" /><br /><input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\" /><br /><img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\" /><br /></form>\n</div>\n<div class=\"box-10 box-last\">\n<p>    <b> Photography Contest</b><br />\n    sponsored by <a href=\"http://www.vnps.net\">The Vietnamese Photographic Sociciety (VNPS)</a></p>\n<p>    <b>Theme</b>: Open<br />\n    Each participant may enter a maximum of 4 digital color images<br /><b>Entry Fee</b>: $10<br />\n    All entries and entrance fees must be received by <b>May 12, 2012.</b></p>\n<p>    <b>Judging Criteria</b><br />\n    All digital images will be judged by the Vietnamese Photographic Society (VNPS)<br />\n    The judges\' decisions are final.<br />\n    Winning images will be displayed at the festival including those accepted from the Judges Panel<br />\n    Awards will be presented to the winners at the festival<br /><b>Awards:</b>: VNPS Gold, VNPS Silver and VNPS Bronze Mdeals,  and 12 Honorable Mentions (HMs) will be awarded</p>\n<p>    <b>Digital Image Rules</b><br />\n    •   Each entrant may submit a max of 4 digital color images in JPG format<br />\n    •   Maximum digital image width (horizontal) is 1024 pixels<br />\n    •   Maximum digital image height (vertical) is 768 pixels<br />\n    •   Invalid image format and size will be disqualified from the contest</p>\n<p>    <img src=\"http://vietfest.com/sites/all/themes/vietfest/images/contests/ImageSize.jpg\" alt=\"Image Size\" /></p>\n<p>    <b> Copyright and Reproduction</b><br />\n    •   The copyright of all submitted work, including full control of use, must be at the disposal of the entrant.  All contributing images must be the work of the photographer and clip art and other imagery derived from a commercial source is unacceptable, even if free of copyright.<br />\n    •   VietFest and VNPS accept no liability for any breach of copyright by an entrant. The copyright of all entries remains with the authors.<br />\n    •   VietFest and VNPS reserve the right to reproduce, without payment, any accepted images for publicity and promotion purposes in connection with the contest and VietFest and VNPS in general, including VietFest and VNPS website.</p>\n<p>    Those who win award(s) agree to email their award winning pictures at higher resolution to the organizing committee for exhibition purpose by <b>June 9, 2012.</b><br />\n    List of awards and list of acceptances will be available on <b> June 9th 2012</b></p>\n<p>    Questions, comments or issue. Please contact <a href=\"mailto:photography@vietfest.com\">photography@vietfest.com</a>\n</p></div>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:node:11','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1945:\"The National Organization of Vietnamese American Leaders Of the Greater Washington DC Area was established, in part, to contribute to the development of future Vietnamese American leaders in the Washington DC metropolitan area.  In furtherance of that mission, we are proud to sponsor a $1,000 scholarship for a high school senior, college, or graduate student who have ties to the East Coast and who have demonstrated a commitment to serving the Vietnamese American communities in that region.  The scholarship recipient is selected on the basis of community service, academic performance, essay, and to a more limited extent, his/her connection to the Vietnamese American community on the East Coast. The scholarship recipient will be expected to attend the awards ceremony at the Vietnamese Heritage Festival held on June 23, 2012 at George Mason University to be recognized and awarded.  The deadline to submit the scholarship application is June 8, 2012.\r\n\r\nPlease attach the following documents to the application and send your package either by regular mail to NOVAL Scholarship, c/o Daniel F. Albert; 130 M St., N.E. #818, Washington, D.C. 20002, or by email to DanielAlbert@gmail.com, postmarked no later than June 8, 2012:\r\n•	Resume (please include any honors and awards)\r\n•	Unofficial copy of your most recent high school or college transcript\r\n•	One to two letters of reference \r\n•	An essay in English or Vietnamese (not to exceed 750 words in Times New Roman font, size 12 font, double space) addressing the following question:\r\n\r\n“Describe your most memorable experience in serving the Vietnamese-American community and how you plan to serve the community in the future.”\r\n\r\n\r\nPlease download, complete the <a href=\"http://vietfest.com/sites/all/themes/vietfest/doc/NOVAL 2012 Scholarship Application.pdf\"> application</a> and send to DanielAlbert@gmail.com\r\nOr mail to\r\nNOVAL-DC\r\nP.O. Box 34437\r\nWashington, DC  20043.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2090:\"<p>The National Organization of Vietnamese American Leaders Of the Greater Washington DC Area was established, in part, to contribute to the development of future Vietnamese American leaders in the Washington DC metropolitan area.  In furtherance of that mission, we are proud to sponsor a $1,000 scholarship for a high school senior, college, or graduate student who have ties to the East Coast and who have demonstrated a commitment to serving the Vietnamese American communities in that region.  The scholarship recipient is selected on the basis of community service, academic performance, essay, and to a more limited extent, his/her connection to the Vietnamese American community on the East Coast. The scholarship recipient will be expected to attend the awards ceremony at the Vietnamese Heritage Festival held on June 23, 2012 at George Mason University to be recognized and awarded.  The deadline to submit the scholarship application is June 8, 2012.</p>\n<p>Please attach the following documents to the application and send your package either by regular mail to NOVAL Scholarship, c/o Daniel F. Albert; 130 M St., N.E. #818, Washington, D.C. 20002, or by email to <a href=\"mailto:DanielAlbert@gmail.com\">DanielAlbert@gmail.com</a>, postmarked no later than June 8, 2012:<br />\n•	Resume (please include any honors and awards)<br />\n•	Unofficial copy of your most recent high school or college transcript<br />\n•	One to two letters of reference<br />\n•	An essay in English or Vietnamese (not to exceed 750 words in Times New Roman font, size 12 font, double space) addressing the following question:</p>\n<p>“Describe your most memorable experience in serving the Vietnamese-American community and how you plan to serve the community in the future.”</p>\n<p>Please download, complete the <a href=\"http://vietfest.com/sites/all/themes/vietfest/doc/NOVAL 2012 Scholarship Application.pdf\"> application</a> and send to <a href=\"mailto:DanielAlbert@gmail.com\">DanielAlbert@gmail.com</a><br />\nOr mail to<br />\nNOVAL-DC<br />\nP.O. Box 34437<br />\nWashington, DC  20043.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:node:12','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:1248:\"<div class=\"box-3\">\r\n<img src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/pho_bowl.jpg\" width=\"215\" alt=\"Pho Eating Competition\"/>\r\n\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"BRJDMFMHHTYUC\">\r\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n<img alt=\"\" align=\"center\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n\r\n</div>\r\n\r\n<div class=\"box-10 box-last\">\r\n\r\n<b>Sponsored by <a href=\"http://www.eastwind.biz/\"> East Wind Restaurant </a> </b>\r\nParticipants will eat one large bowl in the quickest time possible. Limited to 10 minutes.\r\nPre-registration is highly recommended\r\nEntry will be on a first come, first register basis\r\nPre-registration fee is $10 per person\r\nEvent day fee is $20 per person\r\nGrand Prize $100\r\n</div>\r\n\r\n<iframe src=\"https://docs.google.com/spreadsheet/embeddedform?formkey=dDVkUHVSY2VnZU1RaTNvaFZaendUX1E6MQ\" width=\"860\" height=\"950\" frameborder=\"0\" marginheight=\"0\" marginwidth=\"0\">Loading...</iframe>\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1291:\"<div class=\"box-3\">\n<img src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/pho_bowl.jpg\" width=\"215\" alt=\"Pho Eating Competition\" /><form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\n<input type=\"hidden\" name