vancing the well-being of the Vietnamese American community.\r\n\r\n<h4>What we do</h4>\r\nOur activities are aimed at developing leadership skills among our members, promoting civic participation and philanthropy, and fostering community and cultural heritage. We are involved in many community service projects with other nonprofit organizations. Our largest event and fundraiser is the Vietnamese Heritage Festival (VietFest). Our funds are used to provide grants to other non-profit organizations and scholarships to young leaders, support Vietnamese American leadership and cultural programs, train our members, and promote the growth of NOVAL.\r\n\r\n<h4>Why we organized</h4>\r\nAfter over 35 years in the US, the Vietnamese American community has had many individual success stories, but the community as a whole is still disadvantaged. We believe that by bringing together our community, resources, and leaders, we can have a significant voice in mainstream America.  We hope to cultivate more Vietnamese American leaders who are well-versed in both the Vietnamese and American cultures and have the necessary skills to help address certain issues in the Vietnamese American community. NOVAL is at the helm of this new national movement, with chapters in Houston, Atlanta, Dallas, Chicago, San Jose, and Washington, DC. After 35 years as refugees, now is the time to unite and advance together as one community.\r\n\r\n<h4>How we unite: VietFest</h4>\r\nThe Vietnamese Heritage Festival is an event that will not only showcase our beautiful culture but also support the Vietnamese American community by marketing local businesses, restaurants and nonprofit organizations to the Greater Washington, DC community. There will be authentic cuisines from all three regions of Vietnam, games and carnivals for children, a fashion show by Vietnamese American designers and entertainment from popular Vietnamese singers and performers. In addition, there will be competitions in Chinese chess, ping-pong, art, photography, and writing. VietFest will be a fun and exciting event for people of all ages.\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2483:\"<h4>Who we are</h4>\n<p>The National Organization of Vietnamese American Leaders of Greater Washington, DC (NOVAL-DC) is a community-based nonprofit organization with a mission to develop sustainable leadership among Vietnamese Americans and preserve and promote the Vietnamese heritage. We are comprised of professionals and college students who are passionate and committed towards advancing the well-being of the Vietnamese American community.</p>\n<h4>What we do</h4>\n<p>Our activities are aimed at developing leadership skills among our members, promoting civic participation and philanthropy, and fostering community and cultural heritage. We are involved in many community service projects with other nonprofit organizations. Our largest event and fundraiser is the Vietnamese Heritage Festival (VietFest). Our funds are used to provide grants to other non-profit organizations and scholarships to young leaders, support Vietnamese American leadership and cultural programs, train our members, and promote the growth of NOVAL.</p>\n<h4>Why we organized</h4>\n<p>After over 35 years in the US, the Vietnamese American community has had many individual success stories, but the community as a whole is still disadvantaged. We believe that by bringing together our community, resources, and leaders, we can have a significant voice in mainstream America.  We hope to cultivate more Vietnamese American leaders who are well-versed in both the Vietnamese and American cultures and have the necessary skills to help address certain issues in the Vietnamese American community. NOVAL is at the helm of this new national movement, with chapters in Houston, Atlanta, Dallas, Chicago, San Jose, and Washington, DC. After 35 years as refugees, now is the time to unite and advance together as one community.</p>\n<h4>How we unite: VietFest</h4>\n<p>The Vietnamese Heritage Festival is an event that will not only showcase our beautiful culture but also support the Vietnamese American community by marketing local businesses, restaurants and nonprofit organizations to the Greater Washington, DC community. There will be authentic cuisines from all three regions of Vietnam, games and carnivals for children, a fashion show by Vietnamese American designers and entertainment from popular Vietnamese singers and performers. In addition, there will be competitions in Chinese chess, ping-pong, art, photography, and writing. VietFest will be a fun and exciting event for people of all ages.</p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:node:3','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:6475:\"<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/daniel.jpg\" alt=\"Daniel Albert\"/>\r\n    <h4>Daniel Nhật Đan Albert, MBA, JD, LLM</h4>\r\n    <p class=\"staff-title\">\r\n        Chairman and President\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Daniel Nhật Đan Albert is a public finance tax attorney at the law firm of Ballard Spahr, LLP, in Washington, DC where he advises investment bankers, financial advisers, and state and local governmental entities on the issuance of municipal bonds to finance public infrastructures, schools, universities, and other public programs such as low-income housing, student loans, and mortgages. He received his biomedical engineering degree from Tulane University and MBA from the University of New Orleans.  He also earned his law degree from North Carolina Central School of Law and Master of Laws in taxation from Northwestern University School of Law.\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>ChiLan Vu</h4>\r\n    <p class=\"staff-title\">\r\n        Vice President\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        ChiLan Vu currently serves as the Secretary of the Board of Examination for the Lasallian Alumni Association and a game day volunteer with DC United Soccer team. In 2002, she received the “Illuminating the Way Service Award” for her service to the community. Previously, she has also served as an assistant for the Chief Financial Officer in the Purple Heart Car Donation Program, a leader in the Eucharistic Youth Movement in the USA, and a Venture Crew Assistant Advisor of Troop 904 in Arlington,VA.\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Van Tran</h4>\r\n    <p class=\"staff-title\">\r\n        Secretary\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/nick.jpg\" alt=\"Nick Lepham\"/>\r\n    <h4>Nick Lepham</h4>\r\n    <p class=\"staff-title\">\r\n        Treasurer\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Nicholas Lepham is the Special Assistant for Administration at the Center for American Progress. He is responsible for implementing several vital human resource operations and developing new employee procedures and programs to enhance the Center’s efficiency.  Most recently, Nicholas co-founded and serves as Chair of the Asian American Action Group (AAAG), the organizing arm of the Asian American Action Fund PAC. With the AAAG, Lepham oversees its creation and manages its activities as an emerging political entity that works to empower young Asian-Americans into political careers and improve the voice of the AAPI community.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Andy Tran</h4>\r\n    <p class=\"staff-title\">\r\n        Finance Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Andy Tran is Sales Manager with Wells Fargo Home Mortgage and specializes in new home construction. Andy has been involved in the financial services industry for 16 years, and has personally managed over $250 million in residential loans. Andy is a Board member of the DC Metro Chapter of the Asian Real Estate Association of America and has played an active role on the Conference Planning Committee. He is also a lifetime volunteer as a financial literacy trainer for BPSOS (Boat People SOS) and NAVASA (National Alliance of Vietnamese American Service Agencies), both of which are national Asian American non-profit institutions with a housing/financial literacy program as a primary offering to the general public.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Lan Anh Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Programming Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Running one of the most successful new State Farm Agencies in the Mid-Atlantic Region, Anh Nguyen owns and operates her insurance office in the heart of Old Town, Alexandria.  Aside from her business, she is involved in the community through philanthropy and volunteerism.  She enjoys leveraging her own business as well as her business connections to help give back to the community as much as she can.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/sandy.jpg\" alt=\"Sandy Cao\"/>\r\n    <h4>Sandy Cao</h4>\r\n    <p class=\"staff-title\">\r\n        Operations Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Sandy Cao is currently an Operations/Project Manager at an IT consulting firm in Fairfax, VA. She is a graduate of the University of Virginia with a major in Psychology and a minor in Biology. She began her involvement with the Vietnamese-American community in her freshman year of college as she joined the university’s Vietnamese Student Association, which eventually led to her role as President of the association in her senior year. Sandy is also currently the Union of North American Vietnamese Student Association\'s Collective Philanthropy Project Audit Director, working with the project\'s beneficiaries. \r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Joe Nam Do</h4>\r\n    <p class=\"staff-title\">\r\n        Director of External Communications\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Joseph Nam Do is the founder of DC Viet Alliance, a social networking group that volunteers in the community, hosts charity events, and promotes Vietnamese language, culture, and social causes. He is also a board member for Ket Doan Association and has founded and organized several Asian groups on Meetup.com and Facebook.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/duke.jpg\" alt=\"Duke Nguyen\"/>\r\n    <h4>Duke Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Events Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n     Duke Nguyen is a Real Estate Consultant and owner  of Prosperity Investments LLC.  He manages the entire real estate investment process from buying, designing and constructing to selling the property.  He is an active member of the NVAR Multi-Million Dollar Sales Club and a Certified Short-Sale & Foreclosure Resource Specialist. Because of his passion in architectural designs and community service, he finds the real estate profession a perfect fit.  He is also a veteran who honorably served in the US Army.   In his spare time, he regularly participates in philanthropy projects to give back to the community.      \r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Crystal Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Marketing Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n</div>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:6301:\"<div class=\"staff-profile\">\n    <img src=\"sites/all/themes/vietfest/images/team/daniel.jpg\" alt=\"Daniel Albert\" /><h4>Daniel Nhật Đan Albert, MBA, JD, LLM</h4>\n<p class=\"staff-title\">\n        Chairman and President\n    </p>\n<p class=\"staff-desc\">\n        Daniel Nhật Đan Albert is a public finance tax attorney at the law firm of Ballard Spahr, LLP, in Washin