 VA. She is a graduate of the University of Virginia with a major in Psychology and a minor in Biology. She began her involvement with the Vietnamese-American community in her freshman year of college as she joined the university’s Vietnamese Student Association, which eventually led to her role as President of the association in her senior year. Sandy is also currently the Union of North American Vietnamese Student Association\'s Collective Philanthropy Project Audit Director, working with the project\'s beneficiaries.\n</p></div>\n<div class=\"staff-profile\">\n<h4>Joe Nam Do</h4>\n<p class=\"staff-title\">\n        Director of External Communications\n    </p>\n<p class=\"staff-desc\">\n        Joseph Nam Do is the founder of DC Viet Alliance, a social networking group that volunteers in the community, hosts charity events, and promotes Vietnamese language, culture, and social causes. He is also a board member for Ket Doan Association and has founded and organized several Asian groups on Meetup.com and Facebook.\n</p></div>\n<div class=\"staff-profile\">\n    <img src=\"sites/all/themes/vietfest/images/team/duke.jpg\" alt=\"Duke Nguyen\" /><h4>Duke Nguyen</h4>\n<p class=\"staff-title\">\n        Events Director\n    </p>\n<p class=\"staff-desc\">\n     Duke Nguyen is a Real Estate Consultant and owner  of Prosperity Investments LLC.  He manages the entire real estate investment process from buying, designing and constructing to selling the property.  He is an active member of the NVAR Multi-Million Dollar Sales Club and a Certified Short-Sale &amp; Foreclosure Resource Specialist. Because of his passion in architectural designs and community service, he finds the real estate profession a perfect fit.  He is also a veteran who honorably served in the US Army.   In his spare time, he regularly participates in philanthropy projects to give back to the community.\n</p></div>\n<div class=\"staff-profile\">\n<h4>Crystal Nguyen</h4>\n<p class=\"staff-title\">\n        Marketing Director\n    </p>\n<p class=\"staff-desc\">\n</p></div>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:node:4','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:3099:\"We invite you to take advantage of this exceptional advertising and promotional opportunity as a sponsorship participant. Expose your business on our website, e-newsletter, multi-media advertising, T-shirts, banners, speaking engagements and much more. Through sponsors like yourself, we will make this an unforgettable event for the attendees and secure the future of your organizational success. If you have any questions or comments please contact our Sponsorship Director, Lan Anh Nguyen at 703-470-2789 or  sponsor@vietfest.com.\r\n\r\nDownload and read the <a href=\"sites/all/themes/vietfest/doc/Sponsorship Packet.pdf\">Sponsorship Packet</a>\r\n<!--\r\n<h2>Sponsor Packages</h2>\r\n\r\n<div id=\"feature-list-column\" class=\"column\">\r\n                    <h3>&nbsp;</h3>\r\n                    <div class=\"pricing\">&nbsp;</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">Recognized as the top Level Sponsor</li>\r\n                        <li class=\"row-2\">Prominent Display Logo on Main Stage</li>\r\n                        <li class=\"row-3\">Ad space in</li>\r\n                    </ul>\r\n                </div>\r\n                <div id=\"diamond-column\" class=\"column\">\r\n                    <h3>Diamond</h3>\r\n                    <div class=\"pricing\">$20,000</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">Yes</li>\r\n                        <li class=\"row-2\">Yes</li>\r\n                        <li class=\"row-3\">Back Cover</li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div id class=\"column\">\r\n                    <h3>Platinum</h3>\r\n                    <div class=\"pricing\">$10,000</div>\r\n                    <ul>\r\n  