he safer, easier way to pay online!\">\r\n<img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n	<p>If you have any questions, please do not hesitate to contact Van Tran at (904) 502-7369 or <a href=\"mailto:Vendor@vietfest.com\">Vendor@vietfest.com</a>.</p>\r\n\r\n<h3>Downloads:</h3> 	\r\nDownload and read the <a href=\"sites/all/themes/vietfest/doc/Vendor Packet.pdf\">Vendor Packet</a>\r\n\r\nDownload and fill out the <a href=\"sites/all/themes/vietfest/doc/Fairfax County Temp Food Permit Application.pdf\">Fairfax County Temp Food Permit Application</a>\r\n\r\n<img align=\"left\" src=\"http:///vietfest.com/sites/all/themes/vietfest/images/Vendor/food.jpg\" width=920 height=173/>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2409:\"<p><img align=\"left\" src=\"http:///vietfest.com/sites/all/themes/vietfest/images/Vendor/lang vietnam.jpg\" width=\"303\" height=\"234/\" /></p>\n<p> </p>\n<p><b>On behalf of the organizing committee, I would like to invite you to participate in our First Annual Vietnamese Heritage Festival. As a vendor, you will have the opportunity to promote your products and services, provide entertainment and games, or serve authentic ethnic food selections, drinks, and desserts to a large scale audience. Through our various marketing mediums, such as newspaper, television, radio, media advertising, and online promotions, we expect to attract an estimate of 20,000 people to our festival.</b></p>\n<p>Our booths are limited in number, so be sure to reserve your booth as soon as possible.</p>\n<h3>Three categories of booth vendors:</h3>\n<ul><li>Food Vendor- selling foods or drinks</li>\n<li>Exhibition Vendor- advertise your products and services with informational booths and art displays; no exchange of money is permitted</li>\n<li>Games/Commercial Vendor- selling products or services</li>\n</ul><p>\n	    Please forward your complete vendor application and provide a check payable to NOVAL-DC to:\n	</p>\n<address>\n	    VietFest<br />\n        P.O Box 34437<br />\n        Washington, DC 20043<br /></address>\n<p>Payment can be made via Paypal</p>\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\" /><br /><input type=\"hidden\" name=\"hosted_button_id\" value=\"FSPA8TGU2HHVQ\" /><br /><input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\" /><br /><img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\" /><br /></form>\n<p>If you have any questions, please do not hesitate to contact Van Tran at (904) 502-7369 or <a href=\"mailto:Vendor@vietfest.com\">Vendor@vietfest.com</a>.</p>\n<h3>Downloads:</h3>\n<p>Download and read the <a href=\"sites/all/themes/vietfest/doc/Vendor Packet.pdf\">Vendor Packet</a></p>\n<p>Download and fill out the <a href=\"sites/all/themes/vietfest/doc/Fairfax County Temp Food Permit Application.pdf\">Fairfax County Temp Food Permit Application</a></p>\n<p><img align=\"left\" src=\"http:///vietfest.com/sites/all/themes/vietfest/images/Vendor/food.jpg\" width=\"920\" height=\"173/\" /></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124620,1),('field:node:7','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2591:\"<div id=\"events-container\" style=\"width:100%\">\r\n            <dl id=\"event-list\">\r\n                <dt>Tentative Schedule</dt>\r\n                <dd>\r\n                    <div class=\"event-time\">\r\n                        10:00 am\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        VietFest Begins\r\n                    </div>\r\n                </dd>\r\n                <dd class=\"even\">\r\n                    <div class=\"event-time