s/all/themes/vietfest/images/home/chess.jpg\" width=\"150\" height=\"150\" /></a>\n<h5><a href=\"node/13\">Chinese Chess</a></h5>\n</div>\n<div class=\"box-3 box-last\">\n<a href=\"node/14\"><img src=\"http://vietfest.com/sites/all/themes/vietfest/images/contests/Ping Pong.jpg\" width=\"150\" height=\"150/\" /></a>\n<h5><a href=\"node/14\">Ping Pong</a></h5>\n</div>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:node:9','a:1:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:2471:\"<img align=\"left\" src=\"http://vietfest.com/sites/all/themes/vietfest/images/Pageant/Miss VietFest2012.jpg\" width=920 height=599 />\r\nThe Four Beauties of Vietnam:  Princess An Tư   -     Princess Mỵ Châu          -        Princess Ngọc Hân            -         Princess Huyền Trân\r\n&nbsp;<br />\r\n<b><h3>Entering the Miss VietFest  2012 Pageant - Hoa Hậu VietFest 2012</h3></b>\r\n \r\n<strong>Qualification:</strong>\r\n<ul>\r\n      <li> Must be a female of Vietnamese descent, between ages of 17-28.</li>\r\n      <li> Must not be or ever been married or had any children.</li>\r\n      <li> Must be of good health and moral character.</li>\r\n      <li> Be available for all mandatory practices, photo shoots and events.</li>\r\n</ul>\r\n\r\n<strong>Application Process:</strong>\r\n\r\nMust download  and complete the Miss VietFest 2012 Application.  Please submit the application along with a head-shot photo of yourself (shoulder up) via email: missvietfest2012@vietfest.com.\r\n\r\nRegistration fee: $20 non-refundable payable via PayPal.\r\n\r\nTop 20 applicants will be selected for the pageant.\r\n\r\n<strong>Prize:</strong>\r\n<table>\r\n<tr>\r\n<td>\r\nMiss VietFest 2012&nbsp;&nbsp;&nbsp;&nbsp;\r\n</td>\r\n<td>\r\n$1,000\r\n</td>\r\n</tr>\r\n<tr>      \r\n<td>\r\nFirst Runner-Up\r\n</td>\r\n<td>\r\n$500\r\n</td>\r\n</tr>\r\n<tr>      \r\n<td>\r\nSecond Runner-Up\r\n</td>\r\n<td>\r\n$300\r\n</td>\r\n</tr> <tr>      \r\n<td>\r\nMiss Congeniality\r\n</td>\r\n<td>\r\nPhoto shoot package courtesy of CAI Photography ($300 Value)\r\n</td>\r\n</tr>   \r\n </table>            \r\n        \r\n          \r\n\r\n\r\nDEADLINE TO APPLY: <strong style=\"color:red\">Friday, June 1st, 2012.</strong>\r\n\r\nFor questions about the application or the pageant, please contact our Pageant Coordinators: \r\nMimi Nguyen: Mimi.Nguyen@vietfest.com or 703.505.8488\r\nDuke Nguyen: Duke.Nguyen@vietfest.com or 703.395.4444\r\n\r\nDownload and complete:   <a href=\"sites/all/themes/vietfest/doc/Miss VietFest 2012 Application.pdf\">Miss VietFest 2012 Application</a>\r\n\r\n<strong>Submit registration fee here: </strong>\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"LQPDB66PL35EY\">\r\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n<img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:2563:\"<p><img align=\"left\" src=\"http://vietfest.com/sites/all/themes/vietfest/images/Pageant/Miss VietFest2012.jpg\" width=\"920\" height=\"599\" /><br />\nThe Four Beauties of Vietnam:  Princess An Tư   -     Princess Mỵ Châu          -        Princess Ngọc Hân            -         Princess Huyền Trân<br />\n <br /><b><br /><h3>Entering the Miss VietFest  2012 Pageant - Hoa Hậu VietFest 2012</h3>\n<p></p></b></p>\n<p><strong>Qualification:</strong></p>\n<ul><li> Must be a female of Vietnamese descent, between ages of 17-28.</li>\n<li> Must not be or ever been married or had any children.</li>\n<li> Must be of good health and moral character.</li>\n<li> Be available for all mandatory practices, photo shoots and events.</li>\n</ul><p><strong>Application Process:</strong></p>\n<p>Must download  and complete the Miss VietFest 2012 Application.  Please submit the application along with a head-shot photo of yourself (shoulder up) via email: <a href=\"mailto:missvietfest2012@vietfest.com\">missvietfest2012@vietfest.com</a>.</p>\n<p>Registration fee: $20 non-refundable payable via PayPal.</p>\n<p>Top 20 applicants will be selected for the pageant.</p>\n<p><strong>Prize:</strong></p>\n<table><tr><td>\nMiss VietFest 2012    \n</td>\n<td>\n$1,000\n</td>\n</tr><tr><td>\nFirst Runner-Up\n</td>\n<td>\n$500\n</td>\n</tr><tr><td>\nSecond Runner-Up\n</td>\n<td>\n$300\n</td>\n</tr><tr><td>\nMiss Congeniality\n</td>\n<td>\nPhoto shoot package courtesy of CAI Photography ($300 Value)\n</td>\n</tr></table><p>DEADLINE TO APPLY: <strong style=\"color:red\">Friday, June 1st, 2012.</strong></p>\n<p>For questions about the application or the pageant, please contact our Pageant Coordinators:<br />\nMimi Nguyen: <a href=\"mailto:Mimi.Nguyen@vietfest.com\">Mimi.Nguyen@vietfest.com</a> or 703.505.8488<br />\nDuke Nguyen: <a href=\"mailto:Duke.Nguyen@vietfest.com\">Duke.Nguyen@vietfest.com</a> or 703.395.4444</p>\n<p>Download and complete:   <a href=\"sites/all/themes/vietfest/doc/Miss VietFest 2012 Application.pdf\">Miss VietFest 2012 Application</a></p>\n<p><strong>Submit registration fee here: </strong></p>\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\" /><br /><input type=\"hidden\" name=\"hosted_button_id\" value=\"LQPDB66PL35EY\" /><br /><input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\" /><br /><img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\" /><br /></form>\n\";s:12:\"safe_summary\";s:0:\"\";}}}}',0,1335124671,1),('field:user:1','a:0:{}',0,1335147348,1),(