INSERT INTO `field_revision_body` VALUES ('node','page',0,1,1,'und',0,'<STYLE TYPE=\"text/css\">\r\n<!--\r\nP {text-indent: 30pt;}\r\n-->\r\n</STYLE> <p align=\"justify\"> <p style=\"font-family: arial; font-size:13pt\"> Join us for VietFest, June 23, 2012, at George Mason University in Virginia for a unique and spectacular celebration of the best of Vietnamese cuisine, culture, art and entertainment. The festival will feature renowned musical guests; modern fashion from top young designers; and the finest cuisine of the Greater Washington, D.C. area. Other highlights will include a beauty pageant, photo contest and other exciting events.  </p>\r\n\r\n<h2>Event Highlight</h2>\r\n<div class=\"box-4\">\r\n            <a href=\"node/12\"><img src=\"sites/all/themes/vietfest/images/home/pho_bowl.jpg\" alt=\"Pho-Eating Contest\"/></a>\r\n            <h3><a href=\"node/12\">Phở Eating Contest</a></h3>   \r\n</div>\r\n<div class=\"box-4\">\r\n             <a href=\"node/10\"><img src=\"sites/all/themes/vietfest/images/home/photo_contest.jpg\" alt=\"Photo contest\"/></a>\r\n            <h3> <a href=\"node/10\">Photography Contest</a></h3>            \r\n</div>\r\n<div class=\"box-4 box-last\">\r\n             <a href=\"node/13\"><img src=\"sites/all/themes/vietfest/images/home/chess.jpg\" alt=\"Games and much more\"/></a>\r\n             <h3><a href=\"node/12\">Chess (Cờ Tướng) </a> and much  <a href=\"contests\">more </a> !</h3>            \r\n</div>\r\n\r\n<iframe width=\"910\" height=\"512\" src=\"http://www.youtube.com/embed/cfgk5I4o0K0\" frameborder=\"0\" allowfullscreen></iframe>','','full_html'),('node','page',0,2,2,'und',0,'<h4>Who we are</h4>\r\nThe National Organization of Vietnamese American Leaders of Greater Washington, DC (NOVAL-DC) is a community-based nonprofit organization with a mission to develop sustainable leadership among Vietnamese Americans and preserve and promote the Vietnamese heritage. We are comprised of professionals and college students who are passionate and committed towards advancing the well-being of the Vietnamese American community.\r\n\r\n<h4>What we do</h4>\r\nOur activities are aimed at developing leadership skills among our members, promoting civic participation and philanthropy, and fostering community and cultural heritage. We are involved in many community service projects with other nonprofit organizations. Our largest event and fundraiser is the Vietnamese Heritage Festival (VietFest). Our funds are used to provide grants to other non-profit organizations and scholarships to young leaders, support Vietnamese American leadership and cultural programs, train our members, and promote the growth of NOVAL.\r\n\r\n<h4>Why we organized</h4>\r\nAfter over 35 years in the US, the Vietnamese American community has had many individual success stories, but the community as a whole is still disadvantaged. We believe that by bringing together our community, resources, and leaders, we can have a significant voice in mainstream America.  We hope to cultivate more Vietnamese American leaders who are well-versed in both the Vietnamese and American cultures and have the necessary skills to help address certain issues in the Vietnamese American community. NOVAL is at the helm of this new national movement, with chapters in Houston, Atlanta, Dallas, Chicago, San Jose, and Washington, DC. After 35 years as refugees, now is the time to unite and advance together as one community.\r\n\r\n<h4>How we unite: VietFest</h4>\r\nThe Vietnamese Heritage Festival is an event that will not only showcase our beautiful culture but also support the Vietnamese American community by marketing local businesses, restaurants and nonprofit organizations to the Greater Washington, DC community. There will be authentic cuisines from all three regions of Vietnam, games and carnivals for children, a fashion show by Vietnamese American designers and entertainment from popular Vietnamese singers and performers. In addition, there will be competitions in Chinese chess, ping-pong, art, photography, and writing. VietFest will be a fun and exciting event for people of all ages.\r\n','','full_html'),('node','page',0,3,3,'und',0,'<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/daniel.jpg\" alt=\"Daniel Albert\"/>\r\n    <h4>Daniel Nhật Đan Albert, MBA, JD, LLM</h4>\r\n    <p class=\"staff-title\">\r\n        Chairman and President\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Daniel Nhật Đan Albert is a public finance tax attorney at the law firm of Ballard Spahr, LLP, in Washington, DC where he advises investment bankers, financial advisers, and state and local governmental entities on the issuance of municipal bonds to finance public infrastructures, schools, universities, and other public programs such as low-income housing, student loans, and mortgages. He received his biomedical engineering degree from Tulane University and MBA from the University of New Orleans.  He also earned his law degree from North Carolina Central School of Law and Master of Laws in taxation from Northwestern University School of Law.\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>ChiLan Vu</h4>\r\n    <p class=\"staff-title\">\r\n        Vice President\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        ChiLan Vu currently serves as the Secretary of the Board of Examination for the Lasallian Alumni Association and a game day volunteer with DC United Soccer team. In 2002, she received the “Illuminating the Way Service Award” for her service to the community. Previously, she has also served as an assistant for the Chief Financial Officer in the Purple Heart Car Donation Program, a leader in the Eucharistic Youth Movement in the USA, and a Venture Crew Assistant Advisor of Troop 904 in Arlington,VA.\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Van Tran</h4>\r\n    <p class=\"staff-title\">\r\n        Secretary\r\n    </p>\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/nick.jpg\" alt=\"Nick Lepham\"/>\r\n    <h4>Nick Lepham</h4>\r\n    <p class=\"staff-title\">\r\n        Treasurer\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Nicholas Lepham is the Special Assistant for Administration at the Center for American Progress. He is responsible for implementing several vital human resource operations and developing new employee procedures and programs to enhance the Center’s efficiency.  Most recently, Nicholas co-founded and serves as Chair of the Asian American Action Group (AAAG), the organizing arm of the Asian American Action Fund PAC. With the AAAG, Lepham oversees its creation and manages its activities as an emerging political entity that works to empower young Asian-Americans into political careers and improve the voice of the AAPI community.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Andy Tran</h4>\r\n    <p class=\"staff-title\">\r\n        Finance Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Andy Tran is Sales Manager with Wells Fargo Home Mortgage and specializes in new home construction. Andy has been involved in the financial services industry for 16 years, and has personally managed over $250 million in residential loans. Andy is a Board member of the DC Metro Chapter of the Asian Real Estate Association of America and has played an active role on the Conference Planning Committee. He is also a lifetime volunteer as a financial literacy trainer for BPSOS (Boat People SOS) and NAVASA (National Alliance of Vietnamese American Service Agencies), both of which are national Asian American non-profit institutions with a housing/financial literacy program as a primary offering to the general public.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Lan Anh Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Programming Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Running one of the most successful new State Farm Agencies in the Mid-Atlantic Region, Anh Nguyen owns and operates her insurance office in the heart of Old Town, Alexandria.  Aside from her business, she is involved in the community through philanthropy and volunteerism.  She enjoys leveraging her own business as well as her business connections to help give back to the community as much as she can.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/sandy.jpg\" alt=\"Sandy Cao\"/>\r\n    <h4>Sandy Cao</h4>\r\n    <p class=\"staff-title\">\r\n        Operations Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Sandy Cao is currently an Operations/Project Manager at an IT consulting firm in Fairfax, VA. She is a graduate of the University of Virginia with a major in Psychology and a minor in Biology. She began her involvement with the Vietnamese-American community in her freshman year of college as she joined the university’s Vietnamese Student Association, which eventually led to her role as President of the association in her senior year. Sandy is also currently the Union of North American Vietnamese Student Association\'s Collective Philanthropy Project Audit Director, working with the project\'s beneficiaries. \r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Joe Nam Do</h4>\r\n    <p class=\"staff-title\">\r\n        Director of External Communications\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n        Joseph Nam Do is the founder of DC Viet Alliance, a social networking group that volunteers in the community, hosts charity events, and promotes Vietnamese language, culture, and social causes. He is also a board member for Ket Doan Association and has founded and organized several Asian groups on Meetup.com and Facebook.\r\n</div>\r\n<div class=\"staff-profile\">\r\n    <img src=\"sites/all/themes/vietfest/images/team/duke.jpg\" alt=\"Duke Nguyen\"/>\r\n    <h4>Duke Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Events Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n     Duke Nguyen is a Real Estate Consultant and owner  of Prosperity Investments LLC.  He manages the entire real estate investment process from buying, designing and constructing to selling the property.  He is an active member of the NVAR Multi-Million Dollar Sales Club and a Certified Short-Sale & Foreclosure Resource Specialist. Because of his passion in architectural designs and community service, he finds the real estate profession a perfect fit.  He is also a veteran who honorably served in the US Army.   In his spare time, he regularly participates in philanthropy projects to give back to the community.      \r\n</div>\r\n<div class=\"staff-profile\">\r\n    <h4>Crystal Nguyen</h4>\r\n    <p class=\"staff-title\">\r\n        Marketing Director\r\n    </p>\r\n    <p class=\"staff-desc\">\r\n</div>\r\n','','full_html'),('node','page',0,4,4,'und',0,'We invite you to take advantage of this exceptional advertising and promotional opportunity as a sponsorship participant. Expose your business on our website, e-newsletter, multi-media advertising, T-shirts, banners, speaking engagements and much more. Through sponsors like yourself, we will make this an unforgettable event for the attendees and secure the future of your organizational success. If you have any questions or comments please contact our Sponsorship Director, Lan Anh Nguyen at 703-470-2789 or  sponsor@vietfest.com.\r\n\r\nDownload and read the <a href=\"sites/all/themes/vietfest/doc/Sponsorship Packet.pdf\">Sponsorship Packet</a>\r\n<!--\r\n<h2>Sponsor Packages</h2>\r\n\r\n<div id=\"feature-list-column\" class=\"column\">\r\n                    <h3>&nbsp;</h3>\r\n                    <div class=\"pricing\">&nbsp;</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">Recognized as the top Level Sponsor</li>\r\n                        <li class=\"row-2\">Prominent Display Logo on Main Stage</li>\r\n                        <li class=\"row-3\">Ad space in</li>\r\n                    </ul>\r\n                </div>\r\n                <div id=\"diamond-column\" class=\"column\">\r\n                    <h3>Diamond</h3>\r\n                    <div class=\"pricing\">$20,000</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">Yes</li>\r\n                        <li class=\"row-2\">Yes</li>\r\n                        <li class=\"row-3\">Back Cover</li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div id class=\"column\">\r\n                    <h3>Platinum</h3>\r\n                    <div class=\"pricing\">$10,000</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">&nbsp;</li>\r\n                        <li class=\"row-2\">Yes</li>\r\n                        <li class=\"row-3\">Full Page</li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div class=\"column\">\r\n                    <h3>Gold</h3>\r\n                    <div class=\"pricing\">$5,000</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">&nbsp;</li>\r\n                        <li class=\"row-2\">&nbsp;</li>\r\n                        <li class=\"row-3\">Full Page</li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div class=\"column\">\r\n                    <h3>Silver</h3>\r\n                    <div class=\"pricing\">$2,500</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">&nbsp;</li>\r\n                        <li class=\"row-2\">&nbsp;</li>\r\n                        <li class=\"row-3\">Half Page</li>\r\n                    </ul>\r\n                </div>\r\n                \r\n                <div class=\"column\">\r\n                    <h3>Bronze</h3>\r\n                    <div class=\"pricing\">$1,000</div>\r\n                    <ul>\r\n                        <li class=\"row-1\">&nbsp;</li>\r\n                        <li class=\"row-2\">&nbsp;</li>\r\n                        <li class=\"row-3\">Quarter Page</li>\r\n                    </ul>\r\n                </div>\r\n\r\n-->','','full_html'),('node','page',0,5,5,'und',0,'<address>\r\nVietFest<br />\r\nP.O. Box 34437<br />\r\nWashington, DC 20034<br />\r\nEmail: info@vietfest.com<br />\r\nPhone: 202.670.5370<br />\r\n</address>\r\n\r\n<h3>VietFest Directors</h3>\r\n<table id=\"staff-directory\">\r\n            <tr>\r\n                <th>Title</th>\r\n                <th>Name</th>\r\n                <th>Email</th>\r\n            </tr>\r\n            <tr>\r\n                <td>VietFest Chair</td>\r\n                <td>Daniel Nhật Đan Albert</td>\r\n                <td>Daniel.Albert@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Outreach</td>\r\n                <td>ChiLan Vu</td>\r\n                <td>ChiLan.Vu@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Communications</td>\r\n                <td>Nicholas Lepham</td>\r\n                <td>Nicholas.Lepham@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Vendor</td>\r\n                <td>Van Tran</td>\r\n                <td>Van.Tran@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Sponsorship</td>\r\n                <td>Lan Anh Nguyen</td>\r\n                <td>LanAnh.Nguyen@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Internet Marketing</td>\r\n                <td>Joe Nam Do</td>\r\n                <td>Joe.Do@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Carnival and Games</td>\r\n                <td>Diem Tran</td>\r\n                <td>Diem.Tran@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Marketing</td>\r\n                <td>Crystal Nguyen</td>\r\n                <td>Crystal.Nguyen@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Entertainment</td>\r\n                <td>Ich Do</td>\r\n                <td>Ich.Do@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Operations</td>\r\n                <td>Sandy Cao</td>\r\n                <td>Sandy.Cao@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Pageant</td>\r\n                <td>Duke Nguyen</td>\r\n                <td>Duke.Nguyen@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Contests</td>\r\n                <td>Huy Lam</td>\r\n                <td>Huy.Lam@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Cultural</td>\r\n                <td>Lan Le</td>\r\n                <td>Lan.Le@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>IT</td>\r\n                <td>Mike Do</td>\r\n                <td>Mike.Do@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Volunteer</td>\r\n                <td>Stephen Nguyen</td>\r\n                <td>Stephen.Nguyen@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Webmaster</td>\r\n                <td>Quan Ngo</td>\r\n                <td>Quan.Ngo@vietfest.com</td>\r\n            </tr>\r\n            <tr>\r\n                <td>Art and Decorations</td>\r\n                <td>Vi Kha Hoang</td>\r\n                <td>ViKha.Hoang@vietfest.com</td>\r\n            </tr>\r\n        </table>\r\n\r\n<script type=\"text/javascript\">\r\n(function($){\r\n$(\'#staff-directory tr:even\').addClass(\'even\');\r\n})(jQuery);\r\n</script>','','full_html'),('node','page',0,6,6,'und',0,'<img align=\"left\" src=\"http:///vietfest.com/sites/all/themes/vietfest/images/Vendor/lang vietnam.jpg\" width=303 height=234/>\r\n\r\n&nbsp;<br />\r\n\r\n<b>On behalf of the organizing committee, I would like to invite you to participate in our First Annual Vietnamese Heritage Festival. As a vendor, you will have the opportunity to promote your products and services, provide entertainment and games, or serve authentic ethnic food selections, drinks, and desserts to a large scale audience. Through our various marketing mediums, such as newspaper, television, radio, media advertising, and online promotions, we expect to attract an estimate of 20,000 people to our festival.</b>\r\n \r\nOur booths are limited in number, so be sure to reserve your booth as soon as possible.\r\n\r\n\r\n\r\n<h3>Three categories of booth vendors:</h3>\r\n<ul>\r\n	    <li>Food Vendor- selling foods or drinks</li>\r\n	    <li>Exhibition Vendor- advertise your products and services with informational booths and art displays; no exchange of money is permitted</li>\r\n	    <li>Games/Commercial Vendor- selling products or services</li>\r\n	</ul>\r\n	\r\n	<p>\r\n	    Please forward your complete vendor application and provide a check payable to NOVAL-DC to:\r\n	</p>\r\n	<address>\r\n	    VietFest<br />\r\n        P.O Box 34437<br />\r\n        Washington, DC 20043\r\n	</address>\r\n\r\nPayment can be made via Paypal\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"FSPA8TGU2HHVQ\">\r\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n<img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n	<p>If you have any questions, please do not hesitate to contact Van Tran at (904) 502-7369 or <a href=\"mailto:Vendor@vietfest.com\">Vendor@vietfest.com</a>.</p>\r\n\r\n<h3>Downloads:</h3> 	\r\nDownload and read the <a href=\"sites/all/themes/vietfest/doc/Vendor Packet.pdf\">Vendor Packet</a>\r\n\r\nDownload and fill out the <a href=\"sites/all/themes/vietfest/doc/Fairfax County Temp Food Permit Application.pdf\">Fairfax County Temp Food Permit Application</a>\r\n\r\n<img align=\"left\" src=\"http:///vietfest.com/sites/all/themes/vietfest/images/Vendor/food.jpg\" width=920 height=173/>\r\n','','full_html'),('node','page',0,7,7,'und',0,'<div id=\"events-container\" style=\"width:100%\">\r\n            <dl id=\"event-list\">\r\n                <dt>Tentative Schedule</dt>\r\n                <dd>\r\n                    <div class=\"event-time\">\r\n                        10:00 am\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        VietFest Begins\r\n                    </div>\r\n                </dd>\r\n                <dd class=\"even\">\r\n                    <div class=\"event-time\">\r\n                        11:00 am - Noon\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        Opening Ceremony celebration with Lion Dancing\r\n                    </div>\r\n                </dd>\r\n                <dd>\r\n                    <div class=\"event-time\">\r\n                        Noon - 1:00 pm\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        Concert featuring popular Vietnamese singers and performers\r\n                    </div>\r\n                </dd>\r\n                <dd class=\"even\">\r\n                    <div class=\"event-time\">\r\n                        1:00 - 2:00 pm\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        Fashion Show featuring fashion designers Brigitte Le, Tuan K. Nguyen, and Kim Truong\r\n                    </div>\r\n                </dd>\r\n                <dd>\r\n                    <div class=\"event-time\">\r\n                        2:00 - 5:00 pm\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                        Martial Arts Demonstration<br />\r\n                        Cultural Dance Performances<br />\r\n                        Traditional Vietnamese Instrument Presentation<br />\r\n                                    \r\n                    </div>\r\n                </dd>\r\n                <dd class=\"even\">\r\n                    <div class=\"event-time\">\r\n                        5:00 - 5:30 pm\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                       Awards Ceremony for Competitions and NOVAL Leadership Scholarship\r\n                     </div>\r\n                </dd>\r\n                <dd>\r\n                <div class=\"event-time\">\r\n                        5:30 - 8:00 pm\r\n                    </div>\r\n                    <div class=\"event-title\">\r\n                       Miss VietFest 2012 Pageant\r\n                                           </div>\r\n                </dd>\r\n                <dd>\r\n                    <div class=\"event-time\">\r\n                      ','','full_html'),('node','page',0,8,8,'und',0,'<div class=\"box-3\">\r\n<a href=\"node/10\"><img src=\"http://www.vnps.net/_/rsrc/1298229129085/config/customLogo.gif?revision=1\" width=150 height=150 /> </a>\r\n<h5><a href=\"node/10\">VNPS Photography</a></h5>\r\n</div>\r\n\r\n<div class=\"box-3\">\r\n<a href=\"node/12\"><img src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/pho_bowl.jpg\" width=150 height=150/></a>\r\n<h5><a href=\"node/12/\">Pho-Eating </a></h5>\r\n</div>\r\n\r\n<div class=\"box-3\">\r\n<a href=\"node/13\"><img src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/chess.jpg\" width=150 height=150 /></a>\r\n<h5><a href=\"node/13\">Chinese Chess</a></h5>\r\n</div>\r\n\r\n<div class=\"box-3 box-last\">\r\n<a href=\"node/14\"><img src=\"http://vietfest.com/sites/all/themes/vietfest/images/contests/Ping Pong.jpg\" width=150 height=150/></a>\r\n<h5><a href=\"node/14\">Ping Pong</a></h5>\r\n</div>','','full_html'),('node','page',0,9,9,'und',0,'<img align=\"left\" src=\"http://vietfest.com/sites/all/themes/vietfest/images/Pageant/Miss VietFest2012.jpg\" width=920 height=599 />\r\nThe Four Beauties of Vietnam:  Princess An Tư   -     Princess Mỵ Châu          -        Princess Ngọc Hân            -         Princess Huyền Trân\r\n&nbsp;<br />\r\n<b><h3>Entering the Miss VietFest  2012 Pageant - Hoa Hậu VietFest 2012</h3></b>\r\n \r\n<strong>Qualification:</strong>\r\n<ul>\r\n      <li> Must be a female of Vietnamese descent, between ages of 17-28.</li>\r\n      <li> Must not be or ever been married or had any children.</li>\r\n      <li> Must be of good health and moral character.</li>\r\n      <li> Be available for all mandatory practices, photo shoots and events.</li>\r\n</ul>\r\n\r\n<strong>Application Process:</strong>\r\n\r\nMust download  and complete the Miss VietFest 2012 Application.  Please submit the application along with a head-shot photo of yourself (shoulder up) via email: missvietfest2012@vietfest.com.\r\n\r\nRegistration fee: $20 non-refundable payable via PayPal.\r\n\r\nTop 20 applicants will be selected for the pageant.\r\n\r\n<strong>Prize:</strong>\r\n<table>\r\n<tr>\r\n<td>\r\nMiss VietFest 2012&nbsp;&nbsp;&nbsp;&nbsp;\r\n</td>\r\n<td>\r\n$1,000\r\n</td>\r\n</tr>\r\n<tr>      \r\n<td>\r\nFirst Runner-Up\r\n</td>\r\n<td>\r\n$500\r\n</td>\r\n</tr>\r\n<tr>      \r\n<td>\r\nSecond Runner-Up\r\n</td>\r\n<td>\r\n$300\r\n</td>\r\n</tr> <tr>      \r\n<td>\r\nMiss Congeniality\r\n</td>\r\n<td>\r\nPhoto shoot package courtesy of CAI Photography ($300 Value)\r\n</td>\r\n</tr>   \r\n </table>            \r\n        \r\n          \r\n\r\n\r\nDEADLINE TO APPLY: <strong style=\"color:red\">Friday, June 1st, 2012.</strong>\r\n\r\nFor questions about the application or the pageant, please contact our Pageant Coordinators: \r\nMimi Nguyen: Mimi.Nguyen@vietfest.com or 703.505.8488\r\nDuke Nguyen: Duke.Nguyen@vietfest.com or 703.395.4444\r\n\r\nDownload and complete:   <a href=\"sites/all/themes/vietfest/doc/Miss VietFest 2012 Application.pdf\">Miss VietFest 2012 Application</a>\r\n\r\n<strong>Submit registration fee here: </strong>\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"LQPDB66PL35EY\">\r\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n<img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n','','full_html'),('node','webform',0,10,10,'und',0,'<div class=\"box-3\">\r\n    <p><a href=\"http://www.vnps.net\"><img src=\"http://www.vnps.net/_/rsrc/1298229129085/config/customLogo.gif?revision=1\" alt=\"Photography Contest\"/></a><br /></p>\r\n\r\n         <form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n             <input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n             <input type=\"hidden\" name=\"hosted_button_id\" value=\"2539BJ694EJ54\">\r\n             <input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n             <img alt=\"\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n         </form>\r\n\r\n</div>\r\n		\r\n<div class=\"box-10 box-last\">\r\n    \r\n    <b> Photography Contest</b>\r\n    sponsored by <a href=\"http://www.vnps.net\">The Vietnamese Photographic Sociciety (VNPS)</a>\r\n    \r\n    <b>Theme</b>: Open\r\n    Each participant may enter a maximum of 4 digital color images\r\n    <b>Entry Fee</b>: $10 \r\n    All entries and entrance fees must be received by <b>May 12, 2012.</b>\r\n    \r\n    <b>Judging Criteria</b>\r\n    All digital images will be judged by the Vietnamese Photographic Society (VNPS)\r\n    The judges\' decisions are final.\r\n    Winning images will be displayed at the festival including those accepted from the Judges Panel\r\n    Awards will be presented to the winners at the festival\r\n    <b>Awards:</b>: VNPS Gold, VNPS Silver and VNPS Bronze Mdeals,  and 12 Honorable Mentions (HMs) will be awarded\r\n    \r\n    <b>Digital Image Rules</b>\r\n    •   Each entrant may submit a max of 4 digital color images in JPG format \r\n    •   Maximum digital image width (horizontal) is 1024 pixels\r\n    •   Maximum digital image height (vertical) is 768 pixels \r\n    •   Invalid image format and size will be disqualified from the contest\r\n    \r\n    <img src=\"http://vietfest.com/sites/all/themes/vietfest/images/contests/ImageSize.jpg\" alt=\"Image Size\" />\r\n    \r\n    <b> Copyright and Reproduction</b>\r\n    •   The copyright of all submitted work, including full control of use, must be at the disposal of the entrant.  All contributing images must be the work of the photographer and clip art and other imagery derived from a commercial source is unacceptable, even if free of copyright.\r\n    •   VietFest and VNPS accept no liability for any breach of copyright by an entrant. The copyright of all entries remains with the authors.\r\n    •   VietFest and VNPS reserve the right to reproduce, without payment, any accepted images for publicity and promotion purposes in connection with the contest and VietFest and VNPS in general, including VietFest and VNPS website.\r\n    \r\n    Those who win award(s) agree to email their award winning pictures at higher resolution to the organizing committee for exhibition purpose by <b>June 9, 2012.</b>\r\n    List of awards and list of acceptances will be available on <b> June 9th 2012</b>\r\n\r\n    Questions, comments or issue. Please contact photography@vietfest.com\r\n</div>','','full_html'),('node','page',0,11,11,'und',0,'The National Organization of Vietnamese American Leaders Of the Greater Washington DC Area was established, in part, to contribute to the development of future Vietnamese American leaders in the Washington DC metropolitan area.  In furtherance of that mission, we are proud to sponsor a $1,000 scholarship for a high school senior, college, or graduate student who have ties to the East Coast and who have demonstrated a commitment to serving the Vietnamese American communities in that region.  The scholarship recipient is selected on the basis of community service, academic performance, essay, and to a more limited extent, his/her connection to the Vietnamese American community on the East Coast. The scholarship recipient will be expected to attend the awards ceremony at the Vietnamese Heritage Festival held on June 23, 2012 at George Mason University to be recognized and awarded.  The deadline to submit the scholarship application is June 8, 2012.\r\n\r\nPlease attach the following documents to the application and send your package either by regular mail to NOVAL Scholarship, c/o Daniel F. Albert; 130 M St., N.E. #818, Washington, D.C. 20002, or by email to DanielAlbert@gmail.com, postmarked no later than June 8, 2012:\r\n•	Resume (please include any honors and awards)\r\n•	Unofficial copy of your most recent high school or college transcript\r\n•	One to two letters of reference \r\n•	An essay in English or Vietnamese (not to exceed 750 words in Times New Roman font, size 12 font, double space) addressing the following question:\r\n\r\n“Describe your most memorable experience in serving the Vietnamese-American community and how you plan to serve the community in the future.”\r\n\r\n\r\nPlease download, complete the <a href=\"http://vietfest.com/sites/all/themes/vietfest/doc/NOVAL 2012 Scholarship Application.pdf\"> application</a> and send to DanielAlbert@gmail.com\r\nOr mail to\r\nNOVAL-DC\r\nP.O. Box 34437\r\nWashington, DC  20043.','','full_html'),('node','page',0,12,12,'und',0,'<div class=\"box-3\">\r\n<img src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/pho_bowl.jpg\" width=\"215\" alt=\"Pho Eating Competition\"/>\r\n\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"BRJDMFMHHTYUC\">\r\n<input type=\"image\" src=\"https://www.paypalobjects.com/en_US/i/btn/btn_paynowCC_LG.gif\" border=\"0\" name=\"submit\" alt=\"PayPal - The safer, easier way to pay online!\">\r\n<img alt=\"\" align=\"center\" border=\"0\" src=\"https://www.paypalobjects.com/en_US/i/scr/pixel.gif\" width=\"1\" height=\"1\">\r\n</form>\r\n\r\n</div>\r\n\r\n<div class=\"box-10 box-last\">\r\n\r\n<b>Sponsored by <a href=\"http://www.eastwind.biz/\"> East Wind Restaurant </a> </b>\r\nParticipants will eat one large bowl in the quickest time possible. Limited to 10 minutes.\r\nPre-registration is highly recommended\r\nEntry will be on a first come, first register basis\r\nPre-registration fee is $10 per person\r\nEvent day fee is $20 per person\r\nGrand Prize $100\r\n</div>\r\n\r\n<iframe src=\"https://docs.google.com/spreadsheet/embeddedform?formkey=dDVkUHVSY2VnZU1RaTNvaFZaendUX1E6MQ\" width=\"860\" height=\"950\" frameborder=\"0\" marginheight=\"0\" marginwidth=\"0\">Loading...</iframe>','','full_html'),('node','page',0,13,13,'und',0,'<div class=\"box-3\">\r\n    <img align=\"left\" src=\"http://vietfest.com/sites/all/themes/vietfest/images/home/chess.jpg\" alt=\"Chinese Chess Tournament\" width=\"215\"/>   \r\n\r\n<form action=\"https://www.paypal.com/cgi-bin/webscr\" method=\"post\">\r\n<input type=\"hidden\" name=\"cmd\" value=\"_s-xclick\">\r\n<input type=\"hidden\" name=\"hosted_button_id\" value=\"WMLLENT3KDBY4\">\r\n<table>\r\n<tr><td><input type=\"hidden\" name=\"on0\" value=\"Contestant Level\">Contestant Level</td></tr><tr><td