INSERT INTO `search_dataset` VALUES (1,'node',' vietfest june 23 2012 washington dc  join us for vietfest june 23 2012 at george mason university in virginia for a unique and spectacular celebration of the best of vietnamese cuisine culture art and entertainment the festival will feature renowned musical guests modern fashion from top young designers and the finest cuisine of the greater washington dc area other highlights will include a beauty pageant photo contest and other exciting events event highlight phở eating contest photography contest chess cờ tướng  and much more   ',0),(2,'node',' about us who we are the national organization of vietnamese american leaders of greater washington dc novaldc is a communitybased nonprofit organization with a mission to develop sustainable leadership among vietnamese americans and preserve and promote the vietnamese heritage we are comprised of professionals and college students who are passionate and committed towards advancing the wellbeing of the vietnamese american community what we do our activities are aimed at developing leadership skills among our members promoting civic participation and philanthropy and fostering community and cultural heritage we are involved in many community service projects with other nonprofit organizations our largest event and fundraiser is the vietnamese heritage festival vietfest our funds are used to provide grants to other nonprofit organizations and scholarships to young leaders support vietnamese american leadership and cultural programs train our members and promote the growth of noval why we organized after over 35 years in the us the vietnamese american community has had many individual success stories but the community as a whole is still disadvantaged we believe that by bringing together our community resources and leaders we can have a significant voice in mainstream america we hope to cultivate more vietnamese american leaders who are wellversed in both the vietnamese and american cultures and have the necessary skills to help address certain issues in the vietnamese american community noval is at the helm of this new national movement with chapters in houston atlanta dallas chicago san jose and washington dc after 35 years as refugees now is the time to unite and advance together as one community how we unite vietfest the vietnamese heritage festival is an event that will not only showcase our beautiful culture but also support the vietnamese american community by marketing local businesses restaurants and nonprofit organizations to the greater washington dc community there will be authentic cuisines from all three regions of vietnam games and carnivals for children a fashion show by vietnamese american designers and entertainment from popular vietnamese singers and performers in addition there will be competitions in chinese chess pingpong art photography and writing vietfest will be a fun and exciting event for people of all ages  ',0),(3,'node',' our team daniel nhật đan albert mba jd llm chairman and president daniel nhật đan albert is a public finance tax attorney at the law firm of ballard spahr llp in washington dc where he advises investment bankers financial advisers and state and local governmental entities on the issuance of municipal bonds to finance public infrastructures schools universities and other public programs such as lowincome housing student loans and mortgages he received his biomedical engineering degree from tulane university and mba from the university of new orleans he also earned his law degree from north carolina central school of law and master of laws in taxation from northwestern university school of law chilan vu vice president chilan vu currently serves as the secretary of the board of examination for the lasallian alumni association and a game day volunteer with dc united soccer team in 2002 she received the illuminating the way service award for her service to the community previously she has also served as an assistant for the chief financial officer in the purple heart car donation program a leader in the eucharistic youth movement in the usa and a venture crew assistant advisor of troop 904 in arlington va van tran secretary nick lepham treasurer nicholas lepham is the special assistant for administration at the center for american progress he is responsible for implementing several vital human resource operations and developing new employee procedures and programs to enhance the center s efficiency most recently nicholas cofounded and serves as chair of the asian american action group aaag the organizing arm of the asian american action fund pac with the aaag lepham oversees its creation and manages its activities as an emerging political entity that works to empower young asianamericans into political careers and improve the voice of the aapi community andy tran finance director andy tran is sales manager with wells fargo home mortgage and specializes in new home construction andy has been involved in the financial services industry for 16 years and has personally managed over 250 million in residential loans andy is a board member of the dc metro chapter of the asian real estate association of america and has played an active role on the conference planning committee he is also a lifetime volunteer as a financial literacy trainer for bpsos boat people sos and navasa national alliance of vietnamese american service agencies both of which are national asian american nonprofit institutions with a housing financial literacy program as a primary offering to the general public lan anh nguyen programming director running one of the most successful new state farm agencies in the midatlantic region anh nguyen owns and operates her insurance office in the heart of old town alexandria aside from her business she is involved in the community through philanthropy and volunteerism she enjoys leveraging her own business as well as her business connections to help give back to the community as much as she can sandy cao operations director sandy cao is currently an operations project manager at an it consulting firm in fairfax va she is a graduate of the university of virginia with a major in psychology and a minor in biology she began her involvement with the vietnameseamerican community in her freshman year of college as she joined the university s vietnamese student association which eventually led to her role as president of the association in her senior year sandy is also currently the union of north american vietnamese student association s collective philanthropy project audit director working with the project s beneficiaries joe nam do director of external communications joseph nam do is the founder of dc viet alliance a social networking group that volunteers in the community hosts charity events and promotes vietnamese language culture and social causes he is also a board member for ket doan association and has founded and organized several asian groups on meetupcom and facebook duke nguyen events director duke nguyen is a real estate consultant and owner of prosperity investments llc he manages the entire real estate investment process from buying designing and constructing to selling the property he is an active member of the nvar multimillion dollar sales club and a certified shortsale foreclosure resource specialist because of his passion in architectural designs and community service he finds the real estate profession a perfect fit he is also a veteran who honorably served in the us army in his spare time he regularly participates in philanthropy projects to give back to the community crystal nguyen marketing director  ',0),(4,'node',' sponsors we invite you to take advantage of this exceptional advertising and promotional opportunity as a sponsorship participant expose your business on our website enewsletter multimedia advertising tshirts banners speaking engagements and much more through sponsors like yourself we will make this an unforgettable event for the attendees and secure the future of your organizational success if you have any questions or comments please contact our sponsorship director lan anh nguyen at 7034702789 or sponsor vietfestcom  download and read the sponsorship packet ',0),(5,'node',' contact us vietfest po box 34437 washington dc 20034 email  info vietfestcom phone 2026705370 vietfest directors title name email vietfest chair daniel nhật đan albert danielalbert vietfestcom outreach chilan vu chilanvu vietfestcom communications nicholas lepham nicholaslepham vietfestcom vendor van tran vantran vietfestcom sponsorship lan anh nguyen lananhnguyen vietfestcom internet marketing joe nam do joedo vietfestcom carnival and games diem tran diemtran vietfestcom marketing crystal nguyen crystalnguyen vietfestcom entertainment ich do ichdo vietfestcom operations sandy cao sandycao vietfestcom pageant duke nguyen dukenguyen vietfestcom contests huy lam huylam vietfestcom cultural lan le lanle vietfestcom it mike do mikedo vietfestcom volunteer stephen nguyen stephennguyen vietfestcom webmaster quan ngo quanngo vietfestcom art and decorations vi kha hoang vikhahoang vietfestcom ',0),(6,'node',' vendors   on behalf of the organizing committee i would like to invite you to participate in our first annual vietnamese heritage festival as a vendor you will have the opportunity to promote your products and services provide entertainment and games or serve authentic ethnic food selections drinks and desserts to a large scale audience through our various marketing mediums such as newspaper television radio media advertising and online promotions we expect to attract an estimate of 20000 people to our festival our booths are limited in number so be sure to reserve your booth as soon as possible three categories of booth vendors  food vendor selling foods or drinks exhibition vendor advertise your products and services with informational booths and art displays no exchange of money is permitted games commercial vendor selling products or services please forward your complete vendor application and provide a check payable to novaldc to vietfest po box 34437 washington dc 20043 payment can be made via paypal if you have any questions please do not hesitate to contact van tran at 904 5027369 or vendor vietfestcom  downloads  download and read the vendor packet download and fill out the fairfax county temp food permit application ',0),(7,'node',' program tentative schedule 1000 am vietfest begins 1100 am noon opening ceremony celebration with lion dancing noon 100 pm concert featuring popular vietnamese singers and performers 100 200 pm fashion show featuring fashion designers brigitte le tuan k nguyen and kim truong 200 500 pm martial arts demonstration cultural dance performances traditional vietnamese instrument presentation 500 530 pm awards ceremony for competitions and noval leadership scholarship 530 800 pm miss vietfest 2012 pageant  ',0),(8,'node',' contests vnps photography phoeating chinese chess ping pong ',0),(9,'node',' miss vietfest 2012 the four beauties of vietnam princess an tư princess mỵ châu princess ngọc hân princess huyền trân  entering the miss vietfest 2012 pageant hoa hậu vietfest 2012 qualification  must be a female of vietnamese descent between ages of 1728 must not be or ever been married or had any children must be of good health and moral character be available for all mandatory practices photo shoots and events application process  must download and complete the miss vietfest 2012 application please submit the application along with a headshot photo of yourself shoulder up via email  missvietfest2012 vietfestcom  registration fee 20 nonrefundable payable via paypal top 20 applicants will be selected for the pageant prize  miss vietfest 2012 1000 first runnerup 500 second runnerup 300 miss congeniality photo shoot package courtesy of cai photography 300 value deadline to apply  friday june 1st 2012 for questions about the application or the pageant please contact our pageant coordinators mimi nguyen  miminguyen vietfestcom or 7035058488 duke nguyen  dukenguyen vietfestcom or 7033954444 download and complete  miss vietfest 2012 application submit registration fee here  ',0),(10,'node',' photography contest photography contest sponsored by the vietnamese photographic sociciety vnps  theme  open each participant may enter a maximum of 4 digital color images entry fee  10 all entries and entrance fees must be received by may 12 2012 judging criteria all digital images will be judged by the vietnamese photographic society vnps the judges decisions are final winning images will be displayed at the festival including those accepted from the judges panel awards will be presented to the winners at the festival awards   vnps gold vnps silver and vnps bronze mdeals and 12 honorable mentions hms will be awarded digital image rules  each entrant may submit a max of 4 digital color images in jpg format maximum digital image width horizontal is 1024 pixels maximum digital image height vertical is 768 pixels invalid image format and size will be disqualified from the contest copyright and reproduction  the copyright of all submitted work including full control of use must be at the disposal of the entrant all contributing images must be the work of the photographer and clip art and other imagery derived from a commercial source is unacceptable even if free of copyright vietfest and vnps accept no liability for any breach of copyright by an entrant the copyright of all entries remains with the authors vietfest and vnps reserve the right to reproduce without payment any accepted images for publicity and promotion purposes in connection with the contest and vietfest and vnps in general including vietfest and vnps website those who win award s agree to email their award winning pictures at higher resolution to the organizing committee for exhibition purpose by june 9 2012 list of awards and list of acceptances will be available on june 9th 2012 questions comments or issue please contact photography vietfestcom first name last name email image 1 caption image 1 image 2 caption image 2 image 3 caption image 3 image 4 caption image 4 signiture all submission are final by signing this you are agreed to abide to all vietfest 2012 rules and regulations in addition to the rules specified in this document captcha this question is for testing whether you are a human visitor and to prevent automated spam submissions math question 1  solve this simple math problem and enter the result eg for 1 3 enter 4  ',0),(11,'node',' noval scholarship the national organization of vietnamese american leaders of the greater washington dc area was established in part to contribute to the development of future vietnamese american leaders in the washington dc metropolitan area in furtherance of that mission we are proud to sponsor a 1000 scholarship for a high school senior college or graduate student who have ties to the east coast and who have demonstrated a commitment to serving the vietnamese american communities in that region the scholarship recipient is selected on the basis of community service academic performance essay and to a more limited extent his her connection to the vietnamese american community on the east coast the scholarship recipient will be expected to attend the awards ceremony at the vietnamese heritage festival held on june 23 2012 at george mason university to be recognized and awarded the deadline to submit the scholarship application is june 8 2012 please attach the following documents to the application and send your package either by regular mail to noval scholarship c o daniel f albert 130 m st ne 818 washington dc 20002 or by email to danielalbert gmailcom  postmarked no later than june 8 2012 resume please include any honors and awards unofficial copy of your most recent high school or college transcript one to two letters of reference an essay in english or vietnamese not to exceed 750 words in times new roman font size 12 font double space addressing the following question describe your most memorable experience in serving the vietnameseamerican community and how you plan to serve the community in the future please download complete the application and send to danielalbert gmailcom or mail to novaldc po box 34437 washington dc 20043  ',0),(12,'node',' phở eating competition sponsored by east wind restaurant participants will eat one large bowl in the quickest time possible limited to 10 minutes preregistration is highly recommended entry will be on a first come first register basis preregistration fee is 10 per person event day fee is 20 per person grand prize 100 loading  ',0),(13,'node',' cờ tướng chinese chess tournament contestant level beginner 500 usd advance 1000 usd participate in either beginner or advance group beginner preregistration fee is 5 registration fee at festival is 10 50 grand prize advance preregistration fee is 10 registration fee at festival is 15 200 grand prize registration ends at 1230pm and tournament starts at 100pm on day of festival no age restriction no gambling allowed loading  ',0),(14,'node',' ping pong tournament open single player singleelimination tournament tournament starts at 100pm on day of festival preregistration fee is 10 event date registration fee is 15 100 grand prize loading  ',0),(16,'node',' ticket online ticketing for vietfest 2012 powered by eventbrite free admission for wearing full vietnamese traditional dress áo gấm áo dài áo ngũ thân áo yếm áo tứ thân loading number of tickets 20 10000 usd 25 12500 usd 30 15000 usd 50 25000 usd 60 30000 usd 100 50000 usd another amount  ',0),(17,'node',' get involved vendors sign up volunteers sign up sponsors join partners  join ',0),(18,'node',' volunteers loading  ',0);
